import CartIcon from "../CART/CartIcon";

export default function HeaderCartButton() {
  return (
    <button className={styles.button}>
      <span className={styles.icon}>
        <CartIcon />
      </span>
      <span>Your Cart</span>
      <span className={styles.badge}>5</span>
    </button>
  );
}
